import React from "react";

export const RegistrationHeader = () => {
    return (
      <header className="d-flex justify-content-between align-items-center w-100 mb-5">
        <h1 className="fs-1 fw-semibold m-0">Formulir Pendaftaran</h1>
        <img
          src="https://cdn.builder.io/api/v1/image/assets/6e56f22283ca426d8ccf6afbc1731b56/e3977f02412e3db8f910002e785a5e54174d222b?placeholderIfAbsent=true"
          className="img-fluid"
          alt="Registration logo"
          style={{ width: "90px" }}
        />
      </header>
    );
  };
